import React from "react";
import { Box, Typography, TextField, Button } from "@mui/material";

const Register = () => {
  return (
    <Box
      maxWidth={450}
      display={"flex"}
      flexDirection={"column"}
      alignItems={"center"}
      justifyContent={"center"}
      margin={"auto"}
      padding={5}
      borderRadius={5}
    >
      <Typography variant="h4" padding={3} textAlign={"center"}>
        Register
      </Typography>
      <TextField
        placeholder="Name"
        label="Name"
        variant="outlined"
        name="name"
        margin="normal"
        type="text"
        required
      />
      <TextField
        placeholder="Email"
        label="Email"
        variant="outlined"
        name="email"
        margin="normal"
        type="text"
        required
      />
      <TextField
        placeholder="Password"
        label="Password"
        variant="outlined"
        name="password"
        margin="normal"
        type="text"
        required
      />
      <Button sx={{bor}} type="submit" variant="contained" color="primary">Register</Button>
      <Button>Already Registerd ? Please Login</Button>
    </Box>
  );
};

export default Register;
